import React from "react";
import { SafeAreaView, Text, StyleSheet } from "react-native";

const dataOptions = [
    {
        id: Math.random(),
        image: require('../../../assets/ajuda.png'),
        text: 'Área Pix',
    },
    {
        id: Math.random(),
        image: require('../../../assets/ajuda.png'),
        text: 'Área Pix',
    },
    {
        id: Math.random(),
        image: require('../../../assets/ajuda.png'),
        text: 'Área Pix',
    },
    {
        id: Math.random(),
        image: require('../../../assets/ajuda.png'),
        text: 'Área Pix',
    }
]

export default function Options(){
    return(
        <SafeAreaView>
            <Text>ola eu existi</Text>
                <FlatList 
                    horizontal
                    keyExtractor={(item) => item.id} 
                    data={dataOptions} 
                    renderItem={(item) => <OptionComponent image={item.item.image} name={item.item.text} {...item}/>}></FlatList>
            </SafeAreaView>
    )
}
